import React, {Component} from 'react'
import FeedItem from './feedItem'

class unregisteredFeed extends Component{

state = {
    unidentified: []
}

style = {
    overflow: 'scroll',
    height: '350px'
}

render(){

    // get 

    setInterval(()=>{
        console.log("Unrecognized Plate")
        this.state.unidentified.push(<FeedItem
            plateNumber="123456" time="3:30pm" key={Date.now}></FeedItem>
            )
        this.setState({unidentified: this.state.un})
    }, 10000)

    return(
    <div style={this.style}>
        <h1 style={{marginLeft: '25px'}}>Unregistered Activity</h1>
        {this.state.unidentified}
    </div>)}
}


export default unregisteredFeed
